import React, { Component, useState } from 'react';
// import App from '../App';



function Frist() {

    let time = new Date().toLocaleTimeString();



    const [ctime, setCtime] = useState(time);

    const updateTime = () => {
        time = new Date().toLocaleTimeString();

        setCtime(time)
    };

    setInterval(updateTime, 1000)
    return (
        <div>
            <div className="card">
                <h5 className="card-header">Current Time In India <b>UTC/GMT +5:30 hours</b></h5>
                <div className="card-body">
                    <h1 className="card-title">{ctime}</h1>
                    <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>                </div>
            </div>
        </div>
    )
}

export default Frist;
